import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import {Grid} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
    formControl: {
        margin: theme.spacing(1),
        // minWidth: 400,
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
}));

const TrueFalseSelectionsComponent = (props) => {
    const classes = useStyles();
    const [selection, setSelection] = React.useState('');
    const { selectionName } = props

    const handleChange = (event) => {
        setSelection(event.target.value);
    };


    return <div>
        <Grid container>

        <FormControl className={classes.formControl}>
            <InputLabel id="demo-simple-select-label">{selectionName}</InputLabel>
            <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                value={selection}
                onChange={handleChange}
            >
                <MenuItem value={null}>Ignore</MenuItem>
                <MenuItem value={true}>Enabled</MenuItem>
                <MenuItem value={false}>Disabled</MenuItem>
            </Select>
        </FormControl>

        </Grid>

    </div>
}

export default TrueFalseSelectionsComponent
